import './App.css';
import About from './components/About/About';
import Announcement from "./components/Announcements/Announcements";
import Bookings from "./components/Bookings/Bookings";
import FooterContact from "./components/Layout/FooterContact";
import Header from "./components/Layout/Header";
import Navigation from "./components/Navigation/Navigation";
import React, {Fragment}from 'react';


function App() {
  return (
      <Fragment>
          <Navigation />
            <body>
            <h1 style={{textAlign: 'center'}}>WELCOME to be better massage! </h1>
            <Announcement/>
            <About />
            <Bookings/>
            <ul className="honeycomb">
                <li className="honeycomb-cell">

                    <div className="honeycomb-cell_title">About-Me</div>
                </li>
                <li className="honeycomb-cell">

                        <div className="honeycomb-cell_title">Schedule A session</div>
                </li>
                <li className="honeycomb-cell">

                        <div className="honeycomb-cell_title">Contact me</div>
                </li>

                <li className="honeycomb-cell">

                        <div className="honeycomb-cell_title">FAQ<small>filler</small></div>
                </li>
                <li className="honeycomb-cell">

                        <div className="honeycomb-cell_title">filler<small>filler</small></div>
                </li>

                <li className="honeycomb-cell honeycomb_Hidden">
                </li>

            </ul>

            <FooterContact/>

            </body>


      </Fragment>


)
}

export default App;
